import React from 'react';
import { UncontrolledCarousel } from 'reactstrap';
import vasoFront from '../images/vasoFront.jpg';
import vasoSide from '../images/vasoSide.jpg'

const items = [
  {
    src: 'https://images.search.yahoo.com/yhs/search;_ylt=AwrC_DMyvppcAjYAjoQPxQt.;_ylu=X3oDMTB0N2Noc21lBGNvbG8DYmYxBHBvcwMxBHZ0aWQDBHNlYwNwaXZz?p=images&type=8153&hspart=avg&hsimp=yhs-securebrowser&param1=bd321446bf2f4b03b50fe1f567aa0f55&param2=20190220&param3=AVG+Secure+Browser%7C72.0.719.123&param4=11%7CUS%7C1.17.4.377%7C1.17.4.377&ei=UTF-8&fr=yhs-avg-securebrowser#id=0&iurl=https%3A%2F%2Fwww.bmw-me.com%2Fcontent%2Fdam%2Fbmw%2Fcommon%2Fall-models%2F4-series%2Fgran-coupe%2F2017%2Fimages-and-videos%2Fimages%2FBMW-4-series-gran-coupe-images-and-videos-1920x1200-04.jpg.asset.1510606102941.jpg&action=click',
    key: 1,
    altText: 'Slide 1',
    caption: 'Slide 1',
    header: 'Slide 1 Header'
  },
  {
    src: '../images/vasoSide.jpg',
    key: 2,
    altText: 'Slide 2',
    caption: 'Slide 2',
    header: 'Slide 2 Header'
  }
];



const Slider = () => {
    
    return <UncontrolledCarousel items={items} />
} 

export default Slider;
